import { colors, fonts } from "@/theme";
import React from "react";
import { StyleSheet, Text, View } from "react-native";

export const Header = () => (
  <View style={styles.header}>
    <View>
      <Text style={styles.name}>David Smith, Robert Smith</Text>
      <Text style={styles.date}>East Tower (Unit 23)</Text>
      <Text style={styles.unit}>Submitted 11-Nov-2023</Text>
    </View>
    <View>
      <View style={styles.badge}>
        <Text style={styles.badgeText}>Conditional</Text>
      </View>
      <Text style={styles.badgecode}>WS# ADA12221</Text>
    </View>
  </View>
);

const DetailsSection = ({
  title,
  details,
}: {
  title: string;
  details: Array<{ label: string; value: string }>;
}) => (
  <View style={{ padding: 16 }}>
    <View style={styles.section}>
      <View style={styles.sectionHeader}>
        <Text style={styles.sectionTitle}>{title}</Text>
      </View>
      {details.map((detail, index) => (
        <View key={index}>
          <View style={styles.details}>
            <Text style={styles.label}>{detail.label}</Text>
            <Text style={styles.detailText}>{detail.value}</Text>
          </View>
          {index < details.length - 1 && (
            <View style={{ paddingVertical: 12 }}>
              {" "}
              <View style={styles.separator} />{" "}
            </View>
          )}
        </View>
      ))}
    </View>
  </View>
);
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: colors.formBackground,
  },
  separator: {
    padding: 0.3,
    backgroundColor: "lightgray",
    width: "100%",
    alignItems: "center",
  },
  header: {
    backgroundColor: colors.white,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: 16,
    padding: 16,
  },
  name: {
    fontSize: 16,
    fontWeight: 700,
    lineHeight: 24,
    fontFamily: fonts.calibri.bold,
    color: colors.primaryBlue,
    marginBottom: 4,
  },
  date: {
    fontSize: 14,
    fontWeight: 400,
    lineHeight: 20,
    fontFamily: fonts.calibri.regular,
    color: colors.gray,
    marginBottom: 4,
  },
  unit: {
    fontSize: 14,
    fontWeight: 400,
    lineHeight: 20,
    fontFamily: fonts.calibri.regular,
    color: colors.gray,
    marginBottom: 4,
  },
  badge: {
    backgroundColor: colors.conditional,
    borderRadius: 100,
    paddingHorizontal: 12,
    paddingVertical: 4,
    marginBottom: 5,
  },

  badgecode: {
    fontSize: 14,
    fontWeight: 400,
    lineHeight: 20,
    fontFamily: fonts.calibri.regular,
    color: colors.gray,
  },

  badgeText: {
    fontSize: 14,
    fontWeight: 700,
    lineHeight: 20,
    fontFamily: fonts.calibri.bold,
    color: colors.conditionalText,
  },
  section: {
    backgroundColor: "#FFFFFF",
    borderRadius: 8,
    padding: 16,
    paddingBottom: 20,
    marginBottom: 16,

    shadowOffset: { width: 0, height: 2 },
    shadowRadius: 4,
    elevation: 2,
  },
  sectionHeader: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: 10,
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: 700,
    fontFamily: fonts.calibri.bold,
    textAlign: "left",
    marginTop: 12,
    marginBottom: 20,
    color: colors.primaryBlue,
  },

  details: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
  },
  detailText: {
    fontSize: 16,
    color: colors.gray,
    fontFamily: fonts.calibri.regular,
    lineHeight: 20,
    fontWeight: "400",
    textAlign: "right",
    maxWidth: 180,
  },
  label: {
    fontSize: 16,
    color: colors.gray,
    fontFamily: fonts.calibri.bold,

    lineHeight: 20,
    fontWeight: "700",
  },
});

export default DetailsSection;
